    false,nt"url": null,nt"notes": "This data set is a complete digital hydrologic
    unit boundary layer of the Subbasins (8-digit), Watersheds (10-digit), and Subwatersheds
    (12-digit) for Montana. This data set consists of geo-referenced digital data and
    associated attributes created in accordance with the "Federal Guidelines, Requirements,
    and Procedures for the National Watershed Boundary Dataset; Chapter 3 of Section
    A, Federal Standards, Book 11, Collection and Delineation of Spatial Data; Techniques
    and Methods 11-A3" (04/01/2009). http://www.nrcs.usda.gov/wps/portal/nrcs/detail/national/water/watersheds/?cid=nrcs143_021630.
